import Link from 'next/link';

export default function Header(){
    return(
        <div>
        <header className="header">
        <Link href="/">
            <a>
                <img alt="Logo do site" src="/img/logo.svg" height="50" width="300"/>
            </a>
        </Link>
    </header>
        </div>
    )
}
